import React from 'react';

interface RegistrationProps {
    username: string; 
    password: string
}

const RegistrationForm: React.FC<RegistrationProps> = (props) => {
    const { username, password, children } = props;
    return (
        <form noValidate={true}>
            <div className="container">
                <div className="form-group banner">
                    <h2>Register</h2>
                    <p>Username: <input type="text"></input></p>
                    <p>Password: <input type="password"></input></p>
                    <p>First name: <input type="text"></input>Last name: <input type="name"></input></p>
                    <p>Email address: <input type="text"></input></p>
                    <p>Phone number: <input type="number"></input></p>
                    <button className="btn-primary" type="submit">
                        Login
                    </button>
                </div>
            </div>
        </form>
    )
}

export default RegistrationForm;
